const express = require('express');
const app = express();
const dogs = [{
    name: "Duke",
    pic: "https://live.staticflickr.com/65535/50215807437_25dec601c9.jpg"
 }, {
    name: "Zooty",
    pic: "data:image/jpeg;base64,"
  }, {
    name: "Bolt",
    pic: "data:image/jpeg;base64,"
}];

// Set up middleware
app.set('view engine', 'ejs');

app.get('/hi', function (req, res) {
    // query info from database
    // pass it to the ejs file
    res.render('hi.ejs');
});

app.get('/dogs', function(req, res) {
    // let randNum = Math.floor(Math.random() * dogs.length);
    context = {
        errorDog: dogs
    }
    console.log(context);
    res.render('dogs/index.ejs', context)
});

app.get('/dogs/:indexOfDog', function(req, res) {
    console.log(req.params)
    res.send(`<h1>The dog for this url is ${dogs[parseInt(req.params.indexOfDog)]}</h1>`)
})

app.get('/add/:num1/:num2', function(req, res) {
    console.log(req.params);
    res.send(`${req.params.num1} + ${req.params.num2} = ${parseInt(req.params.num1) + parseInt(req.params.num2)}`)
})

